    "Summary report: Contaminants investigations at Nisqually National Wildlife Refuge
    1985 to 1988",nt"tracking_summary": {ntt"total": 5,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T22:42:22.359242",nt"name":
    "summary-report-contaminants-investigations-at-nisqually-national-wildlife-refuge-1985-to-1",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes and analyzes the
    data from four contaminants investigations conducted at Nisqually National Wildlife
    Refuge between 1985 and 1988. Samples of water, sediment, and biota were collected
    from nineteen sites on and adjacent to the refuge. Samples were analyzed for polycyclic
    aromatic hydrocarbon compounds, organochlorine compounds, and a variety of metals.
    Samples were collected by different personnel using different techniques for each
    investigation. Field note documentation was variable. Interpretation of the data
    is limited by the lack of sediment total organic carbon values, sediment grain size
    analysis, and adequate field documentation. Despite the limitations in the data,
    some conclusions and recommendations can be made. The data indicate that there are
    potential areas of concern on the Refuge that should be monitored for arsenic, lead,
    and mercury. These areas are refuge properties adjacent to Interstate-5 and Shannon
    Slough. It is recommended that monitoring conducted as part of the Biological and
    Environmental Status and Trends (BEST) program focus on these areas of the Refuge.
    Soils in the old orchard on the refuge should be investigated as a potential source
    of arsenic. Future sediment and soil sampling should include multiple composite
    grab samples from these areas. The analyses should also include total organic carbon,
    grain size, phosphate, and exchange capacity. Additionally, one or two samples of
    sediments and/or biota contained elevated or potentially elevated concentrations
    of copper, manganese, nickel, vanadium, and zinc. Additional sampling in the future
    would verify the existence and or extent of contamination associated with these
    metals provided the data set is sufficiently large to overcome the variability inherent
    in a small data set.",nt"license_title": "License Not Specified",nt"extras":
